    display: "block",
    marginBottom: "10px",
    color: "black",
    fontSize: "20px",
  },
};

function About() {
  return (
    <div className="right">
      <div style={styles.container}>
        <a href={ExampleDoc} download="MyExampleDoc" target="_blank">
          <Button className={classes.navLink}>My Example Doc</Button>
        </a>
      </div>
    </div>
  );
}

export default About;
